import React from "react";
import PropTypes from "prop-types";
import "./side.css";

Side.prototype = {};

function all() {}

function Side(props) {
  return (
    <div className="sideBar">
      <p onClick="all">All Task</p>
      <p onClick="new">New Task</p>
      <p onClick="doing">Doing Task</p>
      <p onClick="done">Done Task</p>
    </div>
  );
}

export default Side;
